const AllEmployee = (props) => {
    const { details } = props;
    const { id, name, position, department } = details;

    return (
        <tr key={id}>
            <td>{id}</td>
            <td>{name}</td>
            <td>{position}</td>
            <td>{department}</td>
            <td><button onClick={onC}>Delete</button></td>
        </tr>
    );
};

export default AllEmployee;
